import React from 'react'
import { Link } from 'react-router-dom'
import './App.css';

import myImage from './logo.svg'


const MainPage = () =>{
    return (
        <div>
        <h3>Hello im in the index page</h3>
        <Link to="/add"> 
          <img src={myImage} className="image" />
        </Link>
        </div>
    );
  }

export default MainPage;
